import Foundation

public extension CoinGecko {
    
    enum TickerOrder: String {
        case trustScoreDesc = "trust_score_desc" //(default),
        case trustScoreAsc = "trust_score_asc"
        case volumeDesc = "volume_desc"
    }
    
    struct Ticker: Codable {

        enum CodingKeys: String, CodingKey {
            case base
            case target
            //case market
            case last
            case volume
            case convertedLast = "converted_last"
            case convertedVolume = "converted_volume"
            case trustScore = "trust_score"
            case bidAskSpreadPercentage = "bid_ask_spread_percentage"

            case timestamp = "time_stamp"
            case lastTradedAt = "last_traded_at"
            case lastFetchAt = "last_fetch_at"
            case isAnomaly = "is_anomaly"
            case isState = "is_state"
            case tradeURL = "trade_url"
            case tokenInfoURL = "token_info_url"
            case coinId = "coin_id"
            case targetCoinId = "target_coin_id"
        }

        var base: String
        var target: String
        //var market
        var last: Double
        var volume: Double
        var convertedLast: [String: Double]
        var convertedVolume: [String: Double]
        var trustScore: String?
        var bidAskSpreadPercentage: Double?

        var timestamp: String?
        var lastTradedAt: String?
        var lastFetchAt: String?
        var isAnomaly: Bool?
        var isState: Bool?
        var tradeURL: String?
        var tokenInfoURL: String?
        var coinId: String?
        var targetCoinId: String?

        static func get(coin: String, exchange: String, page: Int = 1) async -> [Ticker] {
            if let response: TickerResponse = try? await CoinGecko.tickers(id: coin,
                                    exchangeIds: exchange,
                                    includeLogo: false,
                                    page: page,
                                    order: .trustScoreDesc,
                                    depth: false).getObject() {
                return response.tickers
            }
            return []
        }

    }
    
    public struct TickerResponse: Codable {
        var name: String
        var tickers: [Ticker]
    }
    
    public struct History: Codable {
        
        struct MarketData: Codable {
            var current_price: [String: Double]?
            var market_cap: [String: Double]?
            var total_volume: [String: Double]?
        }

        struct CommunityData: Codable {
            var facebook_likes: Int?
        }

        struct DeveloperData: Codable {
            
            struct CodeAdditions: Codable {
                var additions: Int?
                var deletions: Int?
            }
            var forks: Int?
            var stars: Int?
            var subscribers: Int?
            var total_issues: Int?
            var closed_issues: Int?
            var pull_requests_merged: Int?
            var pull_requests_contributors: Int?
            var code_additions_deletions_4_weeks: CodeAdditions?
            var commit_count_4_weeks: Int?
        }

        var id: String?
        var symbol: String?
        var name: String?
        var localization: [String: String]?
        var image: [String: String]?
        var market_data: MarketData?
//        var community_data: CommunityData?
//        var developer_data: DeveloperData?
//        var public_interest_stats: [String: String]?
        
        static func get(coin: String, date: Date) async -> History? {
            if let response: History = try? await CoinGecko.history(id: coin,
                                                                    date: date,
                                                                    localization: nil).getObject() {
                return response
            }
            return nil
        }
    }
}
